package easy;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.LinkedHashMap;
import java.util.Map;

public class FirstUniqueCharacterInAString {

    public static int firstUniqChar(String s) {
        for (int i = 0; i < s.length(); i++) {
            int count = 0;
            for (int j = 0; j < s.length(); j++) {
                if (s.charAt(i) == s.charAt(j)) {
                    count++;
                }
            }
            if (count == 1) {
                return i;
            }
        }
        return -1;
    }
    // https://leetcode.com/problems/first-unique-character-in-a-string/submissions/1256738039/
    public static int firstUniqCharV2(String s){
        Map<Character, int[]> map = new LinkedHashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if (map.containsKey(s.charAt(i))){
                int[] value = map.get(s.charAt(i));
                value[1]++;
                map.put(s.charAt(i), value);
            }
            else {
                map.put(s.charAt(i), new int[]{i, 0});
            }
        }
        for (Map.Entry<Character, int[]> entry : map.entrySet()) {
            if (entry.getValue()[1] == 0){
                return entry.getValue()[0];
            }
        }
        return -1;
    }

    public static void main(String[] args) {
//        String s = "";
        String s1 = "leetcode";
        String s2 = "loveleetcode";
        String s3 = "aabb";
//        System.out.println(firstUniqChar(s));
        System.out.println(firstUniqCharV2(s1));
        System.out.println(firstUniqCharV2(s2));
        System.out.println(firstUniqCharV2(s3));
    }
}
